The Tenth Inning

Culture, History Documentary hosted by Keith David, published by PBS broadcasted as part of PBS Baseball series in 2010 - English narration


Information
------------------------------

THE TENTH INNING is a documentary film directed by Ken Burns and Lynn Novick. A new chapter in Burns's landmark 1994 series, BASEBALL, THE TENTH INNING tells the tumultuous story of the national pastime from the 1990s to the present day.

Introducing an unforgettable array of players, teams and fans, the film showcases the era's extraordinary accomplishments and heroics Ã‚â€” as well as its devastating losses and disappointments.

Combining extraordinary highlights, stunning still photographs, and insightful commentary by players, managers, and fans, THE TENTH INNING interweaves the story of the national pastime with the story of America.

